$(document).ready(function() {

  $('.jakweb-help').popover({placement: 'right', trigger: 'focus'});
  $('.jakweb-help-left').popover({placement: 'left', trigger: 'focus'});
  $('.jakweb-help-bubble').tooltip({placement: 'top'});
  $('.nav-help-right').tooltip({placement: 'right'});

  // Initialize Slidebars
  var controller = new slidebars();

  // Mobile check
  var windowWidth,

  // Enable/Disable Slidebars
  enableSlidebars = function () {
    windowWidth = $(window).width();
    if (!controller.isActive() && windowWidth < 768) {
      controller.init();
      // Toggle Slidebars
      $('.main-sidebar-toggle').on( 'click', function ( event ) {
        // Stop default action and bubbling
        event.stopPropagation();
        event.preventDefault();

        // Toggle the Slidebar with id 'id-1'
        controller.toggle('menu-left');
      });
    } else if (windowWidth >= 768 && controller.isActive()) {
      $('.main-sidebar').removeAttr('style');
      controller.exit();
    }
  };
  enableSlidebars();

  $(window).on('resize', enableSlidebars);

});

// Toggle Sound Alert
function toggleAlert() {
  if(ls.muted) {
    $('#sound_alert').html('<i class="fa fa-volume-off"></i>').addClass("btn-spacer").removeClass("btn-active");
    ls.muted = 0;
  } else {
    $('#sound_alert').html('<i class="fa fa-volume-up"></i>').removeClass("btn-spacer").addClass("btn-active");
    ls.muted = 1;
  }


  $.ajax({
    type: "POST",
    url: ls.main_url + 'ajax/oprequests.php',
    data: "oprq=sound&sa="+ls.muted+"&uid="+ls.opid,
    dataType: 'json'
  });
}

// Toggle Push Alert
function togglePush() {
  if(ls.pushnotify) {
    $('#push_alert').removeClass('btn-active');
    ls.pushnotify = 0;
  } else {
    $('#push_alert').addClass('btn-active');
    ls.pushnotify = 1;
  }

  $.ajax({
    type: "POST",
    url: ls.main_url + 'ajax/oprequests.php',
    data: "oprq=push&pa="+ls.pushnotify+"&uid="+ls.opid+"&convid="+activeConvID,
    dataType: 'json'
  });
}

/* Password strength indicator */
function passwordStrength(password) {

  var value = [5, 20, 40, 60, 80, 100];
  
  var descClass = ['bg-danger', 'bg-danger', 'bg-danger', 'bg-warning', 'bg-success', 'bg-success'];

  var score = 0;

  // if password is 0 remove all classed
  if (password.length == 0) {
    $("#jak_pstrength").removeClass('bg-danger').removeClass('bg-warning').removeClass('bg-success');
  }

  //if password bigger than 6 give 1 point
  if (password.length > 6) score++;

  //if password has both lower and uppercase characters give 1 point  
  if ((password.match(/[a-z]/)) && (password.match(/[A-Z]/))) score++;

  //if password has at least one number give 1 point
  if (password.match(/\d+/)) score++;

  //if password has at least one special caracther give 1 point
  if ( password.match(/.[!,@,#,$,%,^,&,*,?,_,~,-,(,)]/) ) score++;

  //if password bigger than 12 give another 1 point
  if (password.length > 10) score++;
  
  // display indicator
  $("#jak_pstrength").removeClass(descClass[score-1]).addClass(descClass[score]).attr("aria-valuenow", value[score]).css("width", value[score]+'%');
}

